<awsui-modal>

      <div class="awsui-modal-content awsui-util-container">
        <div class="awsui-modal-header awsui-util-container-header">
          <div class="awsui-modal-title">
            <div awsui-modal-region="header">Create a new repository</div>
          </div>
          <awsui-button class="github-repo-modal-dismiss awsui-modal-dismiss-control" initialized="true">
            <button class="awsui-button awsui-button-no-text awsui-button-variant-icon awsui-hover-child-icons" type="button" override-focus="true">
              <awsui-icon class="awsui-button-icon awsui-button-icon-left" initialized="true">
                <span class="awsui-icon awsui-icon-size-normal awsui-icon-variant-normal">
                  <svg alt="close" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16">
                    <line x1="2" y1="2" x2="14" y2="14"></line>
                    <line x1="14" y1="2" x2="2" y2="14"></line>
                  </svg>
                </span>
              </awsui-icon>
            </button>
          </awsui-button>
        </div>
        <div class="awsui-modal-body awsui-modal-expandtofit">
          <div awsui-modal-region="content">
            <span>
              <div data-reactroot="">
                <p>Create a new repository</p>
                <awsui-form-field initialized="true">
                  <div class="awsui-form-field">
                    <label class="awsui-form-field-label" for="new-repo-name" awsui-form-field-region="label">
                      <span>
                        <span data-reactroot="">
                          <span>Repository name</span>
                        </span>
                      </span>
                    </label>
                    <div class="awsui-grid awsui-form-field-controls">
                      <div class="awsui-row">
                        <div class="awsui-form-field-control col-9 col-xxs-12" awsui-form-field-region="control">
                          <span>
                            <awsui-input data-reactroot="" initialized="true">
                              <span>
                                <input autocomplete="on" class="awsui-input awsui-input-type-text" type="text" id="new-repo-name">
                              </span>
                            </awsui-input>
                          </span>
                        </div>
                      </div>
                    </div>
                  </div>
                  <div class="awsui-form-field">
                    <label class="awsui-form-field-label" for="new-repo-desc" awsui-form-field-region="label">
                      <span>
                        <span data-reactroot="">
                          <span>Description</span>
                        </span>
                      </span>
                    </label>
                    <div class="awsui-grid awsui-form-field-controls">
                      <div class="awsui-row">
                        <div class="awsui-form-field-control col-9 col-xxs-12" awsui-form-field-region="control">
                          <span>
                            <awsui-input data-reactroot="" initialized="true">
                              <span>
                                <input autocomplete="on" class="awsui-input awsui-input-type-text" type="text" id="new-repo-desc">
                              </span>
                            </awsui-input>
                          </span>
                        </div>
                      </div>
                    </div>
                  </div>
                </awsui-form-field>
              </div>
            </span>
          </div>
        </div>
        <div class="awsui-modal-footer awsui-util-container-footer" awsui-modal-region="footer">
          <span>
            <span data-reactroot="">
              <awsui-button class="awsui-util-f-r" initialized="true">
                <button id="github-create-repo" class="awsui-button awsui-button-variant-primary awsui-hover-child-icons" type="submit" override-focus="true">
                  <span awsui-button-region="text">Create</span>
                </button>
              </awsui-button>
              <awsui-button class="awsui-util-f-r" initialized="true">
                <button class="github-repo-modal-dismiss awsui-button awsui-button-variant-link awsui-hover-child-icons" type="submit" override-focus="true">
                  <span awsui-button-region="text">Cancel</span>
                </button>
              </awsui-button>
            </span>
          </span>
        </div>
      </div>
    </div>
  </div>
</div>
